import React from "react";
import NavBar from "../NavBar/NavBar";
import { Box } from "@material-ui/core/";

const Home = () => {
  const root = {
    height: "100%",
    backgroundColor: "red",
  };
  return (
    <Box className={root}>
      <NavBar />
    </Box>
  );
};

export default Home;
